css:
@-moz-document domain("roblox.com"), domain("www.roblox.com") {
html {
    background-color: rgb(35, 37, 39);
}
body{
    background: rgb(35, 37, 39) !important;
    }
#BodyWrapper {
    background: rgb(35, 37, 39) !important;
}
.container-footer {
    background: rgb(35, 37, 39) !important;
}
td {
    background: rgb(35, 37, 39) !important;
}
#MyCreationsTab {
    background: rgb(35, 37, 39) !important;
}
.Ads_WideSkyscraper {
background: rgb(35, 37, 39) !important;
}
#Body.body-width {
background: rgb(35, 37, 39) !important;
}
#build-page .gear-button-wrapper {
background: rgb(35, 37, 39) !important;
}
#build-page td.menu-area a.tab-item {
    color: #fff!important;
}
h2, h2 a:link, h2 a:visited, h2 a:active, h2 .text {
color: #fff!important;
}
.tab-content, .tab-container+div>div {
background: rgb(35, 37, 39) !important;
}
div#catalog .selected {
color: #fff!important;
}
body, .text, pre {
color: #fff!important;
}
h3, h3 a {

color: #fff;
}
.redesign .tab_white_31h_container .ajax__tab_inner, .tab, .tab-container>div {
    background-color: rgb(166, 167, 168);
}
.redesign .tab_white_31h_container .ajax__tab_active .ajax__tab_inner, .tab.active, .tab-container>.tab-active, .tab-container>.tab-active:hover {
    background-color: rgb(35, 37, 39);
}
#build-page table.section-header label.checkbox-label {
    color: #fff;
}
#build-page td.menu-area a.tab-item-selected {
    background-color: rgb(35, 37, 39);
}

#build-page .gear-button-wrapper {
border-color: rgb(35, 37, 39);
}
#build-page .separator {
    background-color: rgb(35, 37, 39);
}
.tab-content, .tab-container+div>div {
border-top: 1px solid rgb(35, 37, 39);
}
#build-page td.content-area {
border-right: 1px solid rgb(35, 37, 39);
}
}
